import React from 'react';
import SearchLocationInput from './components/SearchLocationInput';
import './App.css';

import { Grid, Container, Row, Col} from 'react-bootstrap'

function App() {
  return (
    <div>
      <Container>
        <Row className="rows">
          <Col className="columns">1</Col>
          <Col className="columns">2</Col>
        </Row>
        <Row className="rows">
          <Col className="columns"><SearchLocationInput onChange={console.log}/></Col>
          <Col className="columns">2</Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
